apiVersion: v1
clusters:
- cluster:
    certificate-authority-data: 
    server: https://api.stc.k8s.sparetimecoders.com
  name: stc.k8s.sparetimecoders.com
contexts:
- context:
    cluster: stc.k8s.sparetimecoders.com
    user: stc.k8s.sparetimecoders.com
  name: stc.k8s.sparetimecoders.com
current-context: stc.k8s.sparetimecoders.com
kind: Config
preferences: {}
users:
- name: stc.k8s.sparetimecoders.com
  user:
    exec:
      apiVersion: client.authentication.k8s.io/v1alpha1
      args:
      - token
      - -i
      - stc.k8s.sparetimecoders.com
      command: aws-iam-authenticator
      env:
      - name: AWS_PROFILE
        value: stc
        